import React, { Component } from 'react'
import { connect } from 'react-redux'
import { addTransaction } from '../Redux/Action/ActionCreator'
import AddExpense from './AddExpense'
// import { addTransaction } from '../Redux/Action/ActionCreator'

 class AddExpenseProps extends Component {
    constructor(props){
        super(props)
    }
    render() {
        const {transactions, addTransaction} = this.props
        console.log(transactions)
        return (
            <div>
                <AddExpense
                 id={transactions[0] ? transactions[0].id + 1 : 1}
                 addTransaction={transactions => addTransaction(transactions)}/>
            </div>
        )
    }
}

const mapStateToProps = state => ({
    transactions: state.transaction
})

const mapDispatchToProps = dispatch => ({
    addTransaction: (transaction) => dispatch(addTransaction(transaction))
})

export default connect(mapStateToProps, mapDispatchToProps)(AddExpenseProps)
